          'com.docker.extension.detailed-description': '\u003Ch1\u003EInterSystems \u003Ca href="http://containers.intersystems.com/"\u003EContainer Registry\u003C/a\u003E\u003C/h1\u003E \u003Cp\u003E   This provides a new distribution channel for customers to access container-based releases and previews. All Community   Edition images are available in a public repository with no login required. All full released images (IRIS, IRIS for   Health, Health Connect, System Alerting and Monitoring, InterSystems Cloud Manager) and utility images (such as   arbiter, Web Gateway, and PasswordHash) require a login token, generated from your WRC (Worldwide Response Center)   account credentials. \u003C/p\u003E  \u003Ch1\u003EWhy do I need this Extension\u003C/h1\u003E \u003Cp\u003E   This extension provides integrated UI for InterSystems Container Registry, so, you can easily follow any updates, and quickly find and pull any images available on Container Registry there.   there. \u003C/p\u003E \u003Cp\u003E   Features available \u003Cul\u003E   \u003Cli\u003EObserve the list of available public images\u003C/li\u003E   \u003Cli\u003EObserve the list of available private images for users with access to WRC\u003C/li\u003E   \u003Cli\u003EEasy pulling images\u003C/li\u003E   \u003Cli\u003EDelete local images\u003C/li\u003E   \u003Cli\u003ECopy image name with tag\u003C/li\u003E   \u003Cli\u003EOS Support     \u003Cul\u003E       \u003Cli\u003EWindows x86-64\u003C/li\u003E       \u003Cli\u003ELinux x86-64 and ARM64\u003C/li\u003E       \u003Cli\u003EmacOS x86-64 and ARM64\u003C/li\u003E     \u003C/ul\u003E   \u003C/li\u003E   \u003Cli\u003EFilter images by name and tag\u003C/li\u003E   \u003Cli\u003EFilter for ARM64 images\u003C/li\u003E \u003C/ul\u003E \u003C/p\u003E  \u003Ch1\u003EHow to use\u003C/h1\u003E  \u003Cp\u003E   It is already usable right after installation. And all public images are already available. The list of images is cached, and it is possible to refresh the list manually. \u003C/p\u003E \u003Cp\u003E   To get access to private images with your WRC account, you have to go to \u003Ca href="https://containers.intersystems.com"\u003Ehttps://containers.intersystems.com\u003C/a\u003E login there, and using provided token login in docker.   \u003Cpre\u003E     docker login -u="wrc_username" -p="your_token" containers.intersystems.com   \u003C/pre\u003E   After successful login, return to the extension and press the Refresh button in the top right corner. \u003C/p\u003E \u003Cvideo controls name="media" width="100%" autoplay loop\u003E   \u003Csource src="https://raw.githubusercontent.com/caretdev/docker-intersystems-extension/main/img/InterSystems-Docker-Extension.mp4"/\u003E \u003C/video\u003E  \u003Ch1\u003EAdditionally\u003C/h1\u003E \u003Ch2\u003EInterSystems \u003Ca href="https://community.intersystems.com"\u003EDeveloper Community\u003C/a\u003E\u003C/h2\u003E \u003Cp\u003E   InterSystems Developer Community is a global network of highly experienced technology experts, influencers, and   thought leaders who have expertise in InterSystems technologies. It’s a multilingual platform both for InterSystems   employees, customers and partners. \u003C/p\u003E',
          'com.docker.extension.publisher-url':        'https://github.com/caretdev/docker-intersystems-extension',
